<script>
export default {
    name: 'card',
    props: ['letters'],
    computed: {
        cardFaceImage() {
            const card = this.$options.__card.replace(/\{\{letters}}/g, this.letters);
            return  URL.createObjectURL(new Blob([card], { type: 'image/svg+xml; charset=UTF-8' }));
        },
    },
};
